import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0905001 from '../../include/Pop_C0905001';
import Pop_C0905002 from '../../include/Pop_C0905002';
import Pop_C0905003 from '../../include/Pop_C0905003';
import Pop_C0905004 from '../../include/Pop_C0905004';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'분류 및 SOP 명'}

                            />
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm02'}
                                name={'sm02'}
                                label={'문서번호'}

                            />
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="작업표준관리(SOP)">
                            <Pop_C0905001/>
                            <Pop_C0905003/>
                            <Pop_C0905002/>
                            <Pop_C0905004/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                                삭제
                            </OwpButton>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0202003"
                                LayoutUrl={'/assets/data/C0202003Def.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
